import React from 'react'
import { useSelector } from 'react-redux'
import { Link } from 'react-router-dom'
import CartCard from './CartCard'

function CartDisplay() {


    const {cart} = useSelector((state) => state.cart)

  return (
    <div>
      {cart.length > 0 ? <div>
        {cart?.map(
          (el) => {
            return (
              <CartCard data={el} />
            )
          }
        )}
      </div> : 
      <div className='flex flex-col space-y-12 items-center justify-center h-screen'>
        <p className='text-center text-[25px] '>Your Cart is Empty</p>
        <Link className='border-2 border-[#3C9379] bg-[#3C9379] text-[white] px-3 py-2'>Go Shopping Now!</Link>
      </div>} 
      
    </div>
  )
}

export default CartDisplay
